import React, { useState } from 'react';
import DataTable from './DataTable';

const SampleDataDisplay = () => {
  // Sample data for demonstration
  const sampleData = [
    { id: 1, name: 'John Smith', age: 17, gender: 'Male', state: 'California', application_date: '2024-01-15', status: 'Pending' },
    { id: 2, name: 'Emily Johnson', age: 25, gender: 'Female', state: 'New York', application_date: '2024-01-20', status: 'Approved' },
    { id: 3, name: 'Michael Brown', age: 19, gender: 'Male', state: 'Texas', application_date: '2024-02-01', status: 'Pending' },
    { id: 4, name: 'Sarah Davis', age: 22, gender: 'Female', state: 'California', application_date: '2024-02-05', status: 'Approved' },
    { id: 5, name: 'James Wilson', age: 18, gender: 'Male', state: 'Florida', application_date: '2024-02-10', status: 'Rejected' },
    { id: 6, name: 'Linda Martinez', age: 30, gender: 'Female', state: 'California', application_date: '2024-02-15', status: 'Approved' },
    { id: 7, name: 'Robert Garcia', age: 16, gender: 'Male', state: 'Arizona', application_date: '2024-02-20', status: 'Pending' },
    { id: 8, name: 'Patricia Rodriguez', age: 24, gender: 'Female', state: 'Illinois', application_date: '2024-02-25', status: 'Approved' },
    { id: 9, name: 'Christopher Lee', age: 21, gender: 'Male', state: 'Washington', application_date: '2024-03-01', status: 'Pending' },
    { id: 10, name: 'Maria Hernandez', age: 19, gender: 'Female', state: 'California', application_date: '2024-03-05', status: 'Approved' },
  ];

  const [activeTab, setActiveTab] = useState('preview');

  const getStatistics = () => {
    const stats = {
      totalRecords: sampleData.length,
      avgAge: Math.round(sampleData.reduce((sum, r) => sum + r.age, 0) / sampleData.length),
      maleCount: sampleData.filter(r => r.gender === 'Male').length,
      femaleCount: sampleData.filter(r => r.gender === 'Female').length,
      approvedCount: sampleData.filter(r => r.status === 'Approved').length,
      pendingCount: sampleData.filter(r => r.status === 'Pending').length,
      rejectedCount: sampleData.filter(r => r.status === 'Rejected').length,
    };
    return stats;
  };

  const stats = getStatistics();

  return (
    <div className="sample-data-display">
      {/* Tab Navigation */}
      <div className="flex space-x-1 mb-4 border-b border-gray-200">
        <button
          onClick={() => setActiveTab('preview')}
          className={`px-4 py-2 text-sm font-medium transition-colors ${
            activeTab === 'preview'
              ? 'text-blue-600 border-b-2 border-blue-600'
              : 'text-gray-500 hover:text-gray-700'
          }`}
        >
          Data Preview
        </button>
        <button
          onClick={() => setActiveTab('statistics')}
          className={`px-4 py-2 text-sm font-medium transition-colors ${
            activeTab === 'statistics'
              ? 'text-blue-600 border-b-2 border-blue-600'
              : 'text-gray-500 hover:text-gray-700'
          }`}
        >
          Statistics
        </button>
        <button
          onClick={() => setActiveTab('schema')}
          className={`px-4 py-2 text-sm font-medium transition-colors ${
            activeTab === 'schema'
              ? 'text-blue-600 border-b-2 border-blue-600'
              : 'text-gray-500 hover:text-gray-700'
          }`}
        >
          Schema
        </button>
      </div>

      {/* Tab Content */}
      {activeTab === 'preview' && (
        <div>
          <p className="text-sm text-gray-600 mb-4">
            Sample dataset with {sampleData.length} records
          </p>
          <DataTable data={sampleData.slice(0, 5)} maxRows={5} />
        </div>
      )}

      {activeTab === 'statistics' && (
        <div className="grid grid-cols-2 gap-4">
          <div className="bg-blue-50 p-4 rounded-lg">
            <div className="text-2xl font-bold text-blue-600">{stats.totalRecords}</div>
            <div className="text-sm text-gray-600">Total Records</div>
          </div>
          <div className="bg-green-50 p-4 rounded-lg">
            <div className="text-2xl font-bold text-green-600">{stats.avgAge}</div>
            <div className="text-sm text-gray-600">Average Age</div>
          </div>
          <div className="bg-purple-50 p-4 rounded-lg">
            <div className="text-2xl font-bold text-purple-600">
              {stats.maleCount}/{stats.femaleCount}
            </div>
            <div className="text-sm text-gray-600">Male/Female</div>
          </div>
          <div className="bg-yellow-50 p-4 rounded-lg">
            <div className="text-2xl font-bold text-yellow-600">{stats.approvedCount}</div>
            <div className="text-sm text-gray-600">Approved</div>
          </div>
        </div>
      )}

      {activeTab === 'schema' && (
        <div className="space-y-2">
          <div className="text-sm font-medium text-gray-700 mb-3">Data Schema</div>
          {Object.keys(sampleData[0]).map((field) => (
            <div key={field} className="flex items-center justify-between py-2 px-3 bg-gray-50 rounded">
              <span className="text-sm font-medium text-gray-700">{field}</span>
              <span className="text-xs text-gray-500 bg-white px-2 py-1 rounded">
                {typeof sampleData[0][field]}
              </span>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SampleDataDisplay;
